import React from 'react';
import {useLocation, useParams} from 'react-router-dom';
const User=()=>{
    const {fname,lname}=useParams()
    const location=useLocation();

    return(
        <>
            
            <h1>User: {fname} {lname}'s page</h1>
            <p>My Current location is {location.pathname}</p>
            {}
        </>
    )
}
export default User
